import { DetailsContainer, ImgBox, BaseStatus, PokemonData,Moves, ImagePokemon  } from './PokemonDatailsStyles';

export default function PokemonDetailsPage() {
 return (
   <>
   <h1>Detalhes do pokemon</h1>
    <DetailsContainer>
      <ImgBox></ImgBox>
      <ImgBox></ImgBox>
      <BaseStatus/>
      <PokemonData/>
      <Moves/>
    </DetailsContainer>
   </>
  );
}
